import React, { useState } from 'react';
import './App.css';
import avatar from './amulya_avatar.jpg';

const sections = [
  { id: 'home', title: 'Overview' },
  { id: 'projects', title: 'Projects' },
  { id: 'about', title: 'About' },
  { id: 'contact', title: 'Contact Info' }
];

function App() {
  const [currentSection, setCurrentSection] = useState('home');
  const handleNavClick = (section) => {
    setCurrentSection(section);
  };

  return (
    <div className="App">
      <Navbar handleNavClick={handleNavClick} />
      <div className="content">
        {sections.map(section => (
          <Section key={section.id} id={section.id} title={section.title} currentSection={currentSection} />
        ))}
      </div>
    </div>
  );
}

function Navbar({ handleNavClick }) {
  return (
    <nav className="navbar">
      <ul>
        {sections.map(section => (
          <li key={section.id}><button onClick={() => handleNavClick(section.id)}>{section.title}</button></li>
        ))}
      </ul>
    </nav>
  );
}

function Section({ id, title, currentSection }) {
  const isActive = id === currentSection;

  return (
    <section id={id} className={`section ${isActive ? 'active' : ''}`}>
      {isActive && (
        <div className="overview">
          <div className="avatar">
            <img src={avatar} alt="Amulya Parashar Avatar" />
          </div>
          <div className="overview-content">
            <h2><strong>Amulya Parashar</strong></h2>
            <p>
              <ul>
                <li>Student in <strong>MIT Manipal</strong>.</li>
                <li>Proficient Coder in<strong> 
                  <ul>
                    <li>C/C++</li>
                    <li>Java/JavaFX</li>
                    <li>MySQL/SQLPlus</li>
                    <li>Python</li>
                    <li>HTML CSS and Javascript</li>
                  </ul>
                </strong></li>
              </ul>
              My skill sets extend to <strong>Data Structures and Algorithms (DSA), Object Oriented Programming (OOPs), Power BI, and Data Analytics</strong>.
            </p>
          </div>
        </div>
      )}
      {id === 'projects' && <Projects />}
      {id === 'about' && <About />}
      {id === 'contact' && <Contact />}
    </section>
  );
}

function Projects() {
  return (
    <div>
      <h2>Projects</h2>
      <p>Content for Projects</p>
    </div>
  );
}

function About() {
  return (
    <div>
      <h2>About</h2>
      <p>Content for About</p>
    </div>
  );
}

function Contact() {
  return (
    <div>
      <h2>Contact Info</h2>
      <p>Content for Contact Info</p>
    </div>
  );
}

export default App;
